import styled from 'styled-components';
import Title from '../components/Title.jsx'

const Application = styled.div`
  border: 1px solid black;
  display: flex;
  flex-direction: column;
  // align-items: center;
  justify-content: center;
`;

const App = () => {
  return (
    <Application>
      <Title></Title>
    </Application>

  )
}

export default App;
